import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { AuthServiceService } from '../auth-service.service';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';


@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  styleUrls: ['./signup.component.scss']
})
export class SignupComponent implements OnInit {

constructor(private service: AuthServiceService,private route: Routerprivate fb: FormBuilder) {
    this.signupForm = this.fb.group({
      organisationName: ['', Validators.required],
      email: ['', [Validators.required, Validators.email]],
      contact: ['', Validators.required],
      password: ['', Validators.required],
      confirmPassword: ['', Validators.required],
      streetAddress: ['', Validators.required],
      district: ['', Validators.required],
      block: ['', Validators.required],
      zipCode: ['', Validators.required],
      state: ['', Validators.required],
    });
  }

  onSubmit() {
    if (this.signupForm.valid) {
      const formData = new FormData();
      Object.entries(this.signupForm.value).forEach(([key, value]) => {
        formData.append(key, value as string);
      });

      // Example: Sending the form data
      console.log('Form Data:', formData);

      // TODO: Submit formData to the backend using HttpClient
    } else {
      console.error('Form is invalid');
    }
  }

}
